import React, { Component } from "react";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App(props) {
  let { pagesize } = props;
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route
            exact
            path="/"
            element={
              <News
                key="Home"
                pagesize={props.pagesize}
                country="in"
                category="general"
              />
            }
          />
          <Route
            exact
            path="/general"
            element={
              <News
                key="general"
                pagesize={props.pagesize}
                country="in"
                category="general"
              />
            }
          />
          <Route
            exact
            path="/business"
            element={
              <News
                key="business"
                pagesize={props.pagesize}
                country="in"
                category="business"
              />
            }
          />
          <Route
            exact
            path="/health"
            element={
              <News
                key="health"
                pagesize={props.pagesize}
                country="in"
                category="health"
              />
            }
          />
          <Route
            exact
            path="/science"
            element={
              <News
                key="science"
                pagesize={props.pagesize}
                country="in"
                category="science"
              />
            }
          />
          <Route
            exact
            path="/technology"
            element={
              <News
                key="technology"
                pagesize={props.pagesize}
                country="in"
                category="technology"
              />
            }
          />
          <Route
            exact
            path="/sports"
            element={
              <News
                key="sports"
                pagesize={props.pagesize}
                country="in"
                category="sports"
              />
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
